ess from any claim or demand, including reasonable attorneys’ fees, made by any third-party due to or arising out of your breach of these Terms of Service or the documents they incorporate by reference, or your violation of any law or the rights of a third-party. </span><br /><br /><span style=\"line-height:inherit;\">SECTION 15 - SEVERABILITY</span><span> </span><br /><span>In the event that any provision of these Terms of Service is determined to be unlawful, void or unenforceable, such provision shall nonetheless be enforceable to the fullest extent permitted by applicable law, and the unenforceable portion shall be deemed to be severed from these Terms of Service, such determination shall not affect the validity and enforceability of any other remaining provisions. </span><br /><br /><span style=\"line-height:inherit;\">SECTION 16 - TERMINATION</span><span> </span><br /><span>The obligations and liabilities of the parties incurred prior to the termination date shall survive the termination of this agreement for all purposes. </span><br /><span>These Terms of Service are effective unless and until terminated by either you or us. You may terminate these Terms of Service at any time by notifying us that you no longer wish to use our Services, or when you cease using our site. </span><br /><span>If in our sole judgment you fail, or we suspect that you have failed, to comply with any term or provision of these Terms of Service, we also may terminate this agreement at any time without notice and you will remain liable for all amounts due up to and including the date of termination; and/or accordingly may deny you access to our Services (or any part thereof). </span><br /><br /><span style=\"line-height:inherit;\">SECTION 17 - ENTIRE AGREEMENT</span><span> </span><br /><span>The failure of us to exercise or enforce any right or provision of these Terms of Service shall not constitute a waiver of such right or provision. </span><br /><span>These Terms of Service and any