UI Emoji\', \'Segoe UI Symbol\';font-style:normal;font-weight:400;\">About Us</h1>\n<div class=\"post-title\" style=\"margin:0px auto 55px;padding:0px;max-width:750px;text-align:center;color:#151515;font-family:\'New York\', \'Iowan Old Style\', \'Apple Garamond\', Baskerville, \'Times New Roman\', \'Droid Serif\', Times, \'Source Serif Pro\', serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\';font-size:17px;font-weight:400;background-color:#ffffff;\"></div>\n<div class=\"page-content-width rte\" style=\"margin:0px auto;padding:0px;max-width:840px;color:#151515;font-family:\'New York\', \'Iowan Old Style\', \'Apple Garamond\', Baskerville, \'Times New Roman\', \'Droid Serif\', Times, \'Source Serif Pro\', serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\';font-size:17px;font-weight:400;background-color:#ffffff;\">\n<p style=\"margin:0px 0px 1.25rem;padding:0px;font-size:inherit;word-spacing:0.001em;\">Pooh Corner was established in 1978 by Mike Ridley as a tearoom and gift shop celebrating everything to do with Winnie the Pooh and A.A. Milne. Based on the edge of the Ashdown Forest, where the original \'Pooh\' books were written, Pooh Corner has been a point of pilgrimage for Pooh fans all over the world. Nearly 50 years since the business was first started, Pooh Corner is still going strong and has changed a lot over the years and, as you now hopefully know now, we have a success successful online shop which has been running since 2020 <span>(we also have a museum now too!)</span>. We are proud to ship all over the world from our little corner of the forest, offering the widest range of Winnie the Pooh merchandise and collectibles available anywhere online.</p>\n</div>','about-us'),(4,4,1,'About us','','Learn more about us','about us, informations','<h1 style=\"margin:0px 0px 1.25rem;padding:0px;font-family:\'New York\', \'Iowan Old Style\', \'Apple Garamond\', Baskerville, \'Times New Roman\', \'Droid Serif\', Times, \'Source Serif Pro\', serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\';font-style:normal;font-weight:400;\">About Us</h1>\n<div class=\"post-title\" style=\"margin:0px auto 55px;padding:0px;max-width:750px;text-align:center;color:#151515;font-family:\'New York\', \'Iowan Old Style\', \'Apple Garamond\', Baskerville, \'Times New Roman\', \'Droid Serif\', Times, \'Source Serif Pro\', serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\';font-size:17px;font-weight:400;background-color:#ffffff;\"></div>\n<div class=\"page-content-width rte\" style=\"margin:0px auto;padding:0px;max-width:840px;color:#151515;font-family:\'New York\', \'Iowan Old Style\', \'Apple Garamond\', Baskerville, \'Times New Roman\', \'Droid Serif\', Times, \'Source Serif Pro\', serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\';font-size:17px;font-weight:400;background-color:#ffffff;\">\n<p style=\"margin:0px 0px 1.25rem;padding:0px;font-size:inherit;word-spacing:0.001em;\">Pooh Corner was established in 1978 by Mike Ridley as a tearoom and gift shop celebrating everything to do with Winnie the Pooh and A.A. Milne. Based on the edge of the Ashdown Forest, where the original \'Pooh\' books were written, Pooh Corner has been a point of pilgrimage for Pooh fans all over the world. Nearly 50 years since the business was first started, Pooh Corner is still going strong and has changed a lot over the years and, as you now hopefully know now, we have a success successful online shop which has been running since 2020 <span>(we also have a museum now too!)</span>. We are proud to ship all over the world from our little corner of the forest, offering the widest range of Winnie the Pooh merchandise and collectibles available anywhere online.</p>\n</div>','about-us'),(5,1,1,'Secure payment','','Our secure payment mean','secure payment, ssl, visa, mastercard, paypal','<h2>Secure payment</h2>\n<h3>Our secure payment</h3>\n<p>With SSL</p>\n<h3>Using Bank Transfer</h3>\n<p>About this services</p>','secure-payment'),(5,4,1,'Secure payment','','Our secure payment mean','secure payment, ssl, visa, mastercard, paypal','<h2>Secure payment</h2>\n<h3>Our secure payment</h3>\n<p>With SSL</p>\n<h3>Using Bank Transfer</h3>\n<p>About this services</p>','secure-payment');
