INSERT INTO `ps_product_lang` VALUES (796,1,1,'\nThis chunky wooden puzzle is ideal for little hands to grasp and put together.\nThis product is made from FSC® - certified wood. By choosing this product, you are supporting responsible management of the world\'s forests. This product comes in beautifully designed, fully recyclable packaging.\nSuitable for 12 months +','\nThis chunky wooden puzzle is ideal for little hands to grasp and put together.\nThis product is made','pooh-4-piece-puzzle','','','','Pooh 4 Piece Puzzle','','','',''),(796,1,4,'\nThis chunky wooden puzzle is ideal for little hands to grasp and put together.\nThis product is made from FSC® - certified wood. By choosing this product, you are supporting responsible management of the world\'s forests. This product comes in beautifully designed, fully recyclable packaging.\nSuitable for 12 months +','\nThis chunky wooden puzzle is ideal for little hands to grasp and put together.\nThis product is made','pooh-4-piece-puzzle','','','','Pooh 4 Piece Puzzle','','','',''),(797,1,1,'\nThe adorable Winnie-the-Pooh 20cm soft toy makes the perfect first companion for baby. Based on the famous character from A.A Milne\'s heart-warming Tales from the Hundred Acre Wood storybooks this classically-styled cuddly toy is made from the highest quality, textured plush fabric with beautifully embroidered features.\n\n\nThe lovable Winnie-the-Pooh soft toy is perfect for baby to snuggle up with and makes a great newborn gift.\n','\nThe adorable Winnie-the-Pooh 20cm soft toy makes the perfect first companion for baby. Based on the','hundred-acre-wood-winnie-the-pooh-soft-toy','','','','Hundred Acre Wood Winnie the Pooh Soft Toy','','','',''),(797,1,4,'\nThe adorable Winnie-the-Pooh 20cm soft toy makes the perfect first companion for baby. Based on the famous character from A.A Milne\'s heart-warming Tales from the Hundred Acre Wood storybooks this classically-styled cuddly toy is made from the highest quality, textured plush fabric with beautifully embroidered features.\n\n\nThe lovable Winnie-the-Pooh soft toy is perfect for baby to snuggle up with and makes a great newborn gift.\n','\nThe adorable Winnie-the-Pooh 20cm soft toy makes the perfect first companion for baby. Based on the','hundred-acre-wood-winnie-the-pooh-soft-toy','','','','Hundred Acre Wood Winnie the Pooh Soft Toy','','','',''),(798,1,1,'This Disney Winnie the Pooh 3D shaped mini mug is moulded to perfectly resemble everyone\'s favourite bear, Winnie the Pooh. \nNumber 01 in our collectable series – collect them all!','This Disney Winnie the Pooh 3D shaped mini mug is moulded to perfectly resemble everyone\'s favourite','winnie-the-pooh-mini-mug','','','','Winnie the Pooh Mini Mug','','','',''),(798,1,4,'This Disney Winnie the Pooh 3D shaped mini mug is moulded to perfectly resemble everyone\'s favourite bear, Winnie the Pooh. \nNumber 01 in our collectable series – collect them all!','This Disney Winnie the Pooh 3D shaped mini mug is moulded to perfectly resemble everyone\'s favourite','winnie-the-pooh-mini-mug','','','','Winnie the Pooh Mini Mug','','','',''),(799,1,1,'Winnie the Pooh is so cuddly and perfect friend  to snuggle up with!\n\nH32 x W20 x D16cm approx.\nMade from polyester fibres\nHand wash only\nSuitable from birth\n\n\n\n\n\n','Winnie the Pooh is so cuddly and perfect friend  to snuggle up with!\n\nH32 x W20 x D16cm approx.\nMade','disney-winnie-the-pooh-plush','','','','Disney Winnie the Pooh Plush','','','',''),(799,1,4,'Winnie the Pooh is so cuddly and perfect friend  to snuggle up with!\n\nH32 x W20 x D16cm approx.\nMade from polyester fibres\nHand wash only\nSuitable from birth\n\n\n\n\n\n','Winnie the Pooh is so cuddly and perfect friend  to snuggle up with!\n\nH32 x W20 x D16cm approx.\nMade','disney-winnie-the-pooh-plush','','','','Disney Winnie the Pooh Plush','','','',''),(800,1,1,'This ceramic mug features a printed image of Pooh and the wording \'Feeling rather 11 O\'clockish!\' above him.