ia\'s first, and supposedly deceased, husband... and if he\'s eally still alive, then Olivia is a bigamist.','Gentle chaos sets in when the absent-minded Mr Pim calls in to see George Marden, bearing some innoc','mr-pim-by-a-a-milne','','','','Mr Pim by A.A. Milne','','','',''),(863,1,1,'How well can you ever know another person?\nHappily married, Reginald and Sylvia seem to lead a perfect, and perfectly quiet, life. They have more than enough money and their own country house. But when success overtakes them, and allure of London life pulls Reginald in, they find parts of themselves they never knew. Where does their happiness really lie?\nReminiscent of Evelyn Waugh, this wry, intimate examination of a relationship is a gem of 1930s literature.','How well can you ever know another person?\nHappily married, Reginald and Sylvia seem to lead a perfe','two-people-by-a-a-milne','','','','Two People by A.A. Milne','','','',''),(863,1,4,'How well can you ever know another person?\nHappily married, Reginald and Sylvia seem to lead a perfect, and perfectly quiet, life. They have more than enough money and their own country house. But when success overtakes them, and allure of London life pulls Reginald in, they find parts of themselves they never knew. Where does their happiness really lie?\nReminiscent of Evelyn Waugh, this wry, intimate examination of a relationship is a gem of 1930s literature.','How well can you ever know another person?\nHappily married, Reginald and Sylvia seem to lead a perfe','two-people-by-a-a-milne','','','','Two People by A.A. Milne','','','',''),(864,1,1,'In his classic autobiography A. A. Milne, with his characteristic self-deprecating humour, recalls a blissfully happy childhood in the company of his brothers, and writes with touching affection about the father he adored.From Westminster School he won a scholarship to Cambridge University where he edited the university magazine, before going out into the world, determined to be a writer. He was assistant editor at Punch and went on to enjoy great success with his novels, plays and stories. And of course he is best remembered for his children\'s novels and verses featuring Winnie-the-Pooh and Christopher Robin.This is both an account of how a writer was formed and a charming period piece on literary life - Milne met countless famous authors including H. G. Wells, J.M Barrie and Rudyard Kipling.','In his classic autobiography A. A. Milne, with his characteristic self-deprecating humour, recalls a','its-too-late-now-by-a-a-milne','','','','Its Too Late Now by A.A Milne','','','',''),(864,1,4,'In his classic autobiography A. A. Milne, with his characteristic self-deprecating humour, recalls a blissfully happy childhood in the company of his brothers, and writes with touching affection about the father he adored.From Westminster School he won a scholarship to Cambridge University where he edited the university magazine, before going out into the world, determined to be a writer. He was assistant editor at Punch and went on to enjoy great success with his novels, plays and stories. And of course he is best remembered for his children\'s novels and verses featuring Winnie-the-Pooh and Christopher Robin.This is both an account of how a writer was formed and a charming period piece on literary life - Milne met countless famous authors including H. G. Wells, J.M Barrie and Rudyard Kipling.','In his classic autobiography A. A. Milne, with his characteristic self-deprecating humour, recalls a','its-too-late-now-by-a-a-milne','','','','Its Too Late Now by A.A Milne','','','',''),(865,1,1,'Millions of readers throughout the world have grown up with the stories and verses of A. A. Milne; have envied Christopher Robin in his enchanted world; laughed at Pooh - a bear of very little brain - and worried about Piglet and his problems. But what was it like to be the small boy with the long hair, smock and wellington boots?\nAt the age of fifty-four Christopher Milne recalled his early childhood, remembering \'the enchanted places\' where he used to play in Sussex. The Hundred Acre Wood, Galleon\'s Lap and Poohsticks Bridge existed not only in the stories and poems but were part of the real world surrounding the Milne home at Cotchford Farm.\nWith deftness and artistry Milne draws a memorable portrait of his father, and an evocative reconstruction of a happy childhood in London and Sussex. It is a story told with humour and modesty.','Millions of readers throughout the world have grown up with the stories and verses of A. A. Milne; h','the-enchanted-places-a-childhood-memoir','','','','The Enchanted Places: A Childhood Memoir','','','',''),(865,1,4,'Millions of readers throughout the world have grown up with the stories and verses of A. A. Milne; have envied Christopher Robin in his enchanted world; laughed at Pooh - a bear of very little brain - and worried about Piglet and his problems. But what was it like to be the small boy with the long hair, smock and wellington boots?\nAt the age of fifty-four Christopher Milne recalled his early childhood, remembering \'the enchanted places\' where he used to play in Sussex. The Hundred Acre Wood, Galleon\'s Lap and Poohsticks Bridge existed not only in the stories and poems but were part of the real world surrounding the Milne home at Cotchford Farm.\nWith deftness and artistry Milne draws a memorable portrait of his father, and an evocative reconstruction of a happy childhood in London and Sussex. It is a story told with humour and modesty.','Millions of readers throughout the world have grown up with the stories and verses of A. A. Milne; h','the-enchanted-places-a-childhood-memoir','','','','The Enchanted Places: A Childhood Memoir','','','',''),(866,1,1,'Come on a heart-warming adventure, inspired by the journey undertaken by an extraordinary bear called Winnie during World War One. From her early days with her mama in the Canadian forest, to her travels with the Veterinary Corps across the country and overseas, Winnie has a remarkable wartime story to tell. And when she meets a little boy called Christopher Robin Milne in London Zoo, he loves her so much that he names his teddy bear Winnie-the-Pooh in her honour. The author, Lindsay Mattick, is the great grand-daughter of Captain Harry Colebourn - who originally rescued Winnie as a cub - and the story contains entries from his real wartime diaries from WW1. The book also includes a selection of artefacts from the Colebourn Family Archives. The result is a one-of-a-kind exploration into the realities of war, the meaning of courage, and the power of friendship, all told through the historic adventures of one astonishing bear.','Come on a heart-warming adventure, inspired by the journey undertaken by an extraordinary bear calle','winnie-s-great-war-paperback','','','','Winnie\'s Great War Paperback','','','',''),(866,1,4,'Come on a heart-warming adventure, inspired by the journey undertaken by an extraordinary bear called Winnie during World War One. From her early days with her mama in the Canadian forest, to her travels with the Veterinary Corps across the country and overseas, Winnie has a remarkable wartime story to tell. And when she meets a little boy called Christopher Robin Milne in London Zoo, he loves her so much that he names his teddy bear Winnie-the-Pooh in her honour. The author, Lindsay Mattick, is the great grand-daughter of Captain Harry Colebourn - who originally rescued Winnie as a cub - and the story contains entries from his real wartime diaries from WW1. The book also includes a selection of artefacts from the Colebourn Family Archives. The result is a one-of-a-kind exploration into the realities of war, the meaning of courage, and the power of friendship, all told through the historic adventures of one astonishing bear.','Come on a heart-warming adventure, inspired by the journey undertaken by an extraordinary bear calle','winnie-s-great-war-paperback','','','','Winnie\'s Great War Paperback','','','',''),(867,1,1,'The first complete collection of A. A. Milne’s short stories for grown-ups**INCLUDES NEWLY DISCOVERED, NEVER-SEEN-BEFORE STORIES**‘Entertainment can be guaranteed’ -- Times Literary Supplement\'His peerless dialogue has its roots in his playwriting career... [he has] extraordinary ease and range\' -- Guardian\'Well crafted and charming, with an occasional satiric bite\' -- New York TimesCollected in full for the first time, Milne\'s short stories are an epiphany and show his renowned charm, concision and whimsical flair in all their brilliance.He paints memorable scenes – from a children’s birthday party, to an accidental encounter with murder, and a case of blackmail – often with an unexpected twist. But he also deals in poignancy, from the girl who pulls the wool over her boyfriend’s eyes, to a first dance and first disappointment or family reunion and domestic dissonance.Beguiling and evocative, Milne’s thought-provoking stories for adults will make you see his works for children in a whole new light.\n','The first complete collection of A. A. Milne’s short stories for grown-ups**INCLUDES NEWLY DISCOVERE','the-complete-short-stories-of-a-a-milne','','','','The Complete Short Stories of A.A. Milne','','','',''),(867,1,4,'The first complete collection of A. A. Milne’s short stories for grown-ups**INCLUDES NEWLY DISCOVERED, NEVER-SEEN-BEFORE STORIES**‘Entertainment can be guaranteed’ -- Times Literary Supplement\'His peerless dialogue has its roots in his playwriting career... [he has] extraordinary ease and range\' -- Guardian\'Well crafted and charming, with an occasional satiric bite\' -- New York TimesCollected in full for the first time, Milne\'s short stories are an epiphany and show his renowned charm, concision and whimsical flair in all their brilliance.He paints memorable scenes – from a children’s birthday party, to an accidental encounter with murder, and a case of blackmail – often with an unexpected twist. But he al