py is so afraid of Roo\'s friends.','The Tigger Movie:\nCelebrate family, friendship and the eternal magic of childhood with this beloved ','pooh-collection-5-big-movies-collection','','','','Pooh Collection: 5 Big Movies Collection','','','',''),(876,1,1,'Walt Disney Animation Studios proudly presents the wonderful new adventure, Winnie the Pooh. Return to the Hundred Acre Wood for a heartwarming original movie, and reunite with the beloved bear and his silly but steadfast friends for a magical family experience. \nWhen sad old Eeyore loses his tail, Owl sends the whole gang – Pooh, Tigger, Rabbit, Piglet, Kanga and Roo – on a wild journey to help Eeyore and save Christopher Robin from the mysterious Backson. In the end, it turns out to be a very busy day for a bear who simply set out to find some hunny. \nInspired by five stories from A.A. Milne’s books and created in Disney’s legendary, hand-drawn style, this all-new classic introduces one of the world’s most cherished characters to a whole new generation. Narrated by John Cleese and bursting with brand-new songs performed by Zooey Deschanel, this wonderfully whimsical film is a must-own for every family’s film collection.','Walt Disney Animation Studios proudly presents the wonderful new adventure, Winnie the Pooh. Return ','winnie-the-pooh-movie-dvd','','','','Winnie the Pooh Movie DVD','','','',''),(876,1,4,'Walt Disney Animation Studios proudly presents the wonderful new adventure, Winnie the Pooh. Return to the Hundred Acre Wood for a heartwarming original movie, and reunite with the beloved bear and his silly but steadfast friends for a magical family experience. \nWhen sad old Eeyore loses his tail, Owl sends the whole gang – Pooh, Tigger, Rabbit, Piglet, Kanga and Roo – on a wild journey to help Eeyore and save Christopher Robin from the mysterious Backson. In the end, it turns out to be a very busy day for a bear who simply set out to find some hunny. \nInspired by five stories from A.A. Milne’s books an