ed making Winnie the Pooh and friends soft toys from her home at 149-07 12th Avenue in Whitestone, Queens. Brush employed a number of women from the local neighbourhood to start a small cottage industry. Brush would check all the toys for quality and would personally finish the characters by sewing on the eyes and paint on touches such as Tigger’s stripes.\nPlease be aware that this is a vintage toy and does show some signs of age, but considering its age it is in very good condition. ','We have this one beautiful (and very rare) Owl available made by Agnes Brush in the late 1940s.\nAgne','agnes-brush-owl-toy','','','','Agnes Brush Owl Toy','','','',''),(1048,1,4,'We have this one beautiful (and very rare) Owl available made by Agnes Brush in the late 1940s.\nAgnes Brush (1904-1982) started out work in New York as a milliner (hat maker) and later transferred her skills to sewing soft toys for Mary Alice Clark. During World WarII, Clark acquired a license to make Winnie the Pooh toys from Stephen Slesinger. Brush in 1948, then assumed the license and started making Winnie the Pooh and friends soft toys from her home at 149-07 12th Avenue in Whitestone, Queens. Brush employed a number of women from the local neighbourhood to start a small cottage industry. Brush would check all the toys for quality and would personally finish the characters by sewing on the eyes and paint on touches such as Tigger’s stripes.\nPlease be aware that this is a vintage toy and does show some signs of age, but considering its age it is in very good condition. ','We have this one beautiful (and very rare) Owl available made by Agnes Brush in the late 1940s.\nAgne','agnes-brush-owl-toy','','','','Agnes Brush Owl Toy','','','',''),(1049,1,1,'\nWe have one beautiful (and very rare) pair of Kanga &amp; Roo toys available made by Agnes Brush in the late 1940s.\nAgnes Brush (1904-1982) started out work in New York as a milliner (hat maker) and later transferred her skills to sewing soft toys for M