d sequel, The Best Bear in all the World with brand-new stories from Paul Bright, Brian Sibley, Kate Saunders and Jeanne Willis - coming soon.\nThe nation’s favourite teddy bear has been delighting generations of children for 90 years.\nMilne’s classic children’s stories – featuring Tigger, Piglet, Eeyore, Christopher Robin and, of course, Pooh himself – are both heart-warming and funny, teaching lessons of friendship and  reflecting the power of a child’s imagination like no other story before or since.  \nPooh ranks alongside other beloved character such as Paddington Bear, and Peter Rabbit as an essential part of our literary heritage. Whether you’re 5 or 55, Pooh is the bear for all ages.\nA.A. Milne is quite simply one of the most famous children’s authors of all time. He created Winnie-the-Pooh and his friends Piglet, Eeyore, Tigger, Kanga and Roo based on the real nursery toys played with by his son, Christopher Robin. And those characters not only became the stars of his classic children’s books, Winnie-the-Pooh and The House at Pooh Corner, and his poetry for children, they have also been adapted for film, TV and the stage. Through his writings for Punch magazine, A.A. Milne met E.H. Shepard. Shepard went on to draw the original illustrations to accompany Milne’s classics, earning him the name “the man who drew Pooh”.','\'Once upon a time, a very long time ago now, about last Friday, Winnie-the-Pooh lived in a forest al','winnie-the-pooh-classic-collection','','','','Winnie The Pooh Classic Collection','','','',''),(1052,1,4,'\'Once upon a time, a very long time ago now, about last Friday, Winnie-the-Pooh lived in a forest all by himself under the name of Sanders.\'\nA. A. Milne\'s stories about Pooh and his friends have been loved by generations of children and their parents since Winnie-the-Pooh was first published in 1926. This magnificent slipcase features the four classic Winnie-the-Pooh titles: Winnie-the-Pooh, The House at Pooh Corner, When We Were V