ocket-library','','','','6 Book Pocket Library','','','',''),(1068,1,1,'Gentle chaos sets in when the absent-minded Mr Pim calls in to see George Marden, bearing some innocent news... George is a fine upstanding citizen and a stickler for doing the right thing. He has a devoted wife, Olivia, and is guardian to his somewhat flighty niece, Dinah.But his careful peace is broken when Mr Pim casually announces that he\'s recently seen an ex-convict from Australia, Telworthy.The only thing is that the character sounds awfully like Olivia\'s first, and supposedly deceased, husband... and if he\'s eally still alive, then Olivia is a bigamist.','Gentle chaos sets in when the absent-minded Mr Pim calls in to see George Marden, bearing some innoc','mr-pim-by-a-a-milne','','','','Mr Pim by A.A. Milne','','','',''),(1068,1,4,'Gentle chaos sets in when the absent-minded Mr Pim calls in to see George Marden, bearing some innocent news... George is a fine upstanding citizen and a stickler for doing the right thing. He has a devoted wife, Olivia, and is guardian to his somewhat flighty niece, Dinah.But his careful peace is broken when Mr Pim casually announces that he\'s recently seen an ex-convict from Australia, Telworthy.The only thing is that the character sounds awfully like Olivia\'s first, and supposedly deceased, husband... and if he\'s eally still alive, then Olivia is a bigamist.','Gentle chaos sets in when the absent-minded Mr Pim calls in to see George Marden, bearing some innoc','mr-pim-by-a-a-milne','','','','Mr Pim by A.A. Milne','','','',''),(1069,1,1,'How well can you ever know another person?\nHappily married, Reginald and Sylvia seem to lead a perfect, and perfectly quiet, life. They have more than enough money and their own country house. But when success overtakes them, and allure of London life pulls Reginald in, they find parts of themselves they never knew. Where does their happiness really lie?\nReminiscent of Evelyn Waugh, this wry, intimate examination of 