kly Planner Desk Pad','','','',''),(1185,1,1,'\nGet ready to embark on an enchanting journey with your favorite characters from the Hundred Acre Wood! Introducing the Winnie the Pooh Crystal Art 3D Scene, a magnificent masterpiece that will transport you to the whimsical world of Winnie the Pooh, Rabbit, Piglet, Eeyore, Tigger, and Frog.\nCrafted with intricate details and dimensions of 18.5cm x 10cm x 25cm, this 3D scene features a magical wonderland where our beloved characters are enjoying the each other\'s companies. But this is not just any regular scene - it is a Crystal Art masterpiece waiting to be brought to life!\nUsing the numbered adhesive template and the crystal pick-up pen provided, you can easily lift and place the coloured resin gems onto the corresponding numbered dots to create a dazzling rhinestone art. The process is not only relaxing and therapeutic, but also a fun and engaging activity suitable for adults and children (ages 8+) alike.\nThis amazing kit contains everything you need to create a stunning 3D scene, including a slated wooden base, tree, Christopher Robinson, Winnie the Pooh, Tigger, Eeyore, Piglet, Rabbit, and the Frog, a crystal pick-up tray, a crystal pick-up pen, gel wax, bags for leftover crystal gems, pre-bagged and labelled crystal gems, and step-by-step instructions.\nAnd when your project is complete, we recommend using our Crystal Art Sealer to prolong the life of your masterpiece and keep it looking beautiful for years to come.\nSo whether you\'re a die-hard Winnie the Pooh fan, a crystal art enthusiast, or simply looking for a unique and memorable gift, the Winnie the Pooh Crystal Art 3D Scene is the perfect addition to your collection. Don\'t miss out on the chance to create a one-of-a-kind masterpiece that will capture the hearts of all who see it! So why wait? Bring the whimsy of the Hundred Acre Wood into your home with this delightful Winnie the Pooh Crystal Art 3D Scene!','\nGet ready to embark on an enchanting jou